function App() {
  const items = [
    {
      title: "React",
      content: "React is a frontend javascript framework.",
    },

    {
      title: "Bable",
      content:
        "Babel is a popular tool for using the newest features of the JavaScript programming language.",
    },

    {
      title: "Next.js",
      content:
        "Next.js is an open-source web development framework built on top of Node.js enabling React based web applications functionalities such as server-side rendering and generating static websites.",
    },
  ];
  return (
    <div>
      <Search />
    </div>
  );
}

export default App;
